import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import Checkbox from './Checkbox';

class CountrySelector extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
    "Select a country",
      <form defaultValue="Nederland">
          <select value={this.state.country}>
            <option value="Nederland">Nederland</option>
            <option value="China">China</option>
          </select>
      </form>
    );
  }
}

class InformationSelector extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
        "Select the information you seek",
        <form>
            <label>
              Is going:
              <input
                name="Temperature"
                type="checkbox"
                checked={this.state.isGoing}
                onChange={this.handleInputChange} />
            </label>
            <label>
              Is going:
              <input
                name="Distance"
                type="checkbox"
                checked={this.state.isGoing}
                onChange={this.handleInputChange} />
            </label>
          </form>
        );
    }
}



ReactDOM.render(<CountrySelector />, document.getElementById('selectCountryForm'));

ReactDOM.render(<Checkbox />, document.getElementById('selectInformationTypes'));
